import React from 'react';
import { Link } from 'react-router-dom';
import MusicList from "./content/MusicList.json"
import "./pages.css"
import { Container, Row, Col } from "react-bootstrap";

import Flores from "../images/wallpapers/Flores.png"
import Abrahadabra from "../images/wallpapers/Abrahadabra.png"
import LagoBrasil from "../images/wallpapers/LagoBrasil.png"
import Feiticeiro from "../images/wallpapers/Feiticeiro.png"

function wallpapers() {
  return (
    <Container>
      <Row>
      <h1>Wallpapers</h1>
      <Col xs={12} sm={6}>
          <img src={Feiticeiro} width="100%" alt=""/>
          <img src={Flores} width="100%" alt=""/>
        </Col>
          <Col xs={12} sm={6}>
            <img src={Abrahadabra} width="100%" alt=""/>
            <img src={LagoBrasil} width="100%" alt=""/>
          </Col>
      </Row>
    </Container>

          );
        }

export default wallpapers;
